import React, { useEffect, useState, useRef } from 'react';
import { Icon } from '@iconify/react';
import { pageTitle } from '../../helper';
import Div from '../Div';
import PageHeading from '../PageHeading';
import SectionHeading from '../SectionHeading';
import Spacing from '../Spacing';
import ContactInfoWidget from '../Widget/ContactInfoWidget';
import emailjs from '@emailjs/browser'; // Import emailjs

export default function ContactPage() {
  const [formType, setFormType] = useState('creator'); // Initialize formType state with 'creator'
  const formRef = useRef(); // Ref for the form

  // Set the page title and scroll to top on component mount
  useEffect(() => {
    pageTitle('Contact Us');
    window.scrollTo(0, 0);
  }, []);

  // Function to handle form type selection
  const handleFormType = (type) => {
    setFormType(type);
  };

  // Function to handle form submission
  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm('service_5ipr9sz', 'template_71s78ys', formRef.current, {
        publicKey: 'NdjSlHBpr70nKRN8d',
      })
      .then(
        () => {
          console.log('SUCCESS!');
        },
        (error) => {
          console.log('FAILED...', error.text);
        },
      );
  };

  // Function to render different forms based on the selected type
  const renderForm = () => {
    switch (formType) {
      case 'brand':
        return (
          <>
            {/* Creator form */}
            <Div className="col-sm-12">
              <label className="cs-primary_color">Budget</label>
              <input type="text" className="cs-form_field" />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <label className="cs-primary_color">Message</label>
              <textarea
                className="cs-form_field"
                style={{ height: '120px' }} // Adjust height as needed
                placeholder="Enter your message here..."
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            {/* Additional fields for creator */}
          </>
        );
      case 'creator':
        return (
          <>
            {/* Brand form */}
            <Div className="col-sm-12">
              <label className="cs-primary_color">Links</label>
              <input
                type="text"
                className="cs-form_field"
                placeholder="Youtube"
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <input
                type="text"
                className="cs-form_field"
                placeholder="Instagram"
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <input
                type="text"
                className="cs-form_field"
                placeholder="tiktok"
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <input
                type="text"
                className="cs-form_field"
                placeholder="twitter"
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <input
                type="text"
                className="cs-form_field"
                placeholder="twitch"
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <label className="cs-primary_color">Followers/subscribers</label>
              <input type="text" className="cs-form_field" />
              <Spacing lg="20" md="20" />
            </Div>
            <Div className="col-sm-12">
              <label className="cs-primary_color">Message</label>
              <textarea
                className="cs-form_field"
                style={{ height: '120px' }} // Adjust height as needed
                placeholder="Enter your message here..."
                readOnly
              />
              <Spacing lg="20" md="20" />
            </Div>
            {/* Additional fields for brand */}
          </>
        );
      default:
        return null;
    }
  };

  return (
    <>
      <style>
        {`
          .cs-btn {
            border: 2px solid #FF4A17; /* Orange outline */
            background-color: black; /* Black background */
            color: white; /* White text */
            border-radius: 10px; /* Rounded corners */
            padding: 10px 20px; /* Adjust padding as needed */
            margin-right: 10px; /* Adjust margin as needed */
            cursor: pointer; /* Cursor style */
            transition: background-color 0.3s, color 0.3s; /* Smooth transition */
          }

          .cs-btn:hover {
            background-color: #FF4A17; /* Orange background on hover */
